import React, { Component } from "react";
// import { render } from "@testing-library/react";

class Innercomponents extends Component {

    state = {
          cars: ["Tesla","tata","audi" ],
          coupe: ["abcd","efgh","ijkl"],
          other: ["component1", "component2"]

        };

        selectvalue = (comingvalue)=>{
            const {cars, coupe,other}=this.state;
            if(comingvalue === "cars"){
                return coupe.map((coup,index) => { return <div key={`${index}_fil`}> {coup}  </div> });
            }
            else if(comingvalue === "coupe"){
                return cars.map((car,index) => { return <div key={`${index}_filter`}> {car}  </div> });
            }
            else {
                return other.map((oth,index) => { return <div key={`${index}_filter`}> {oth}  </div> });
            }
        }

    render(){
        console.log(this.props.filteredValue+" Innercomponentss");
        const comingvalue = this.props.filteredValue;
        return(
            
            <div className="card">
                <div  className="card-body">
        <p>Result of clicking {this.props.filteredValue}</p>
                {this.selectvalue(comingvalue)}
                </div>
            </div>

        );
    }


} 
export default Innercomponents
